import * as React from 'react';

import styles from './experiences.module.scss';

const list = [
  {
    logo: '',
    title: 'Front-end Developer',
    description: '',
    from: '',
    to: '',
  },
];

const Experiences: React.FC = () => {
  return (
    <div className={styles.experiences}>
      <ul>
        {list.map((el, i) => (
          <li key={i}>
            <img src={el.logo} alt="logo" />
            <div>
              <p>
                {el.from} - {el.to}
              </p>
              <p>{el.title}</p>
              <p>{el.description}</p>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export { Experiences };
